import './App.css';

function App() {
  return (
    <main>
      <header>
        <a href="" className="logo">MyBlog</a>
        <nav>
          <a href="">Login</a>
          <a href="">Register</a>
        </nav>

      </header>
      <div className="entry">
            <img src="https://techcrunch.com/wp-content/uploads/2023/07/Cybertruck_78.jpg?w=730&crop=1" alt="" />
            <h2></h2>
          </div>
    </main>
  );
}

export default App;
